import React, { useState } from 'react';
import {
  Text,
  View,
  Image,
  StyleSheet,
  TouchableOpacity,
  TextInput,
} from 'react-native';
import Logo from '../components/Logo';
import axios from 'axios';


export default function Login({navigation}){
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleSubmit = async () => {
    try {
      const response = await axios.post('http://localhost:3000/auth', {
        email,
        password,
      });

      if (response.status === 200) {
        if (response.data.message === '1') {
          // sessionStorage yerine uygun bir veri saklama yöntemi kullanılmalı
          setSuccess('Giriş başarılı, yönlendiriliyorsunuz...');
          alert("giirl");
          setTimeout(() => {
            navigation.navigate('Navbar');
          }, 2000);
        } else {
          setError('Kullanıcı adı veya şifre hatalı');
        }
      }
    } catch (err) {
      setError('Kullanıcı adı ve şifre kontrolünde hata oluştu');
    }
  };

   

  return (
    <View style = {styles.container}>
      <Logo />
      <Text style = {styles.header}>MERHABA,</Text> 
      <Text style = {styles.header2}>TEKRAR HOŞGELDİN !</Text>
      
      <View style={styles.inputContainer}  onSubmit={handleSubmit}>
        <Image source={require('../assets/username.png')} style={styles.image} />
        <TextInput
          style={styles.input}
          placeholder="Kullanıcı Adı"
          onChange= {(e) => setEmail(e.target.value)}
           placeholderTextColor="#381163" 
        />
      </View>
      <View style={styles.inputContainer}>
        <Image source={require('../assets/password.png')} style={styles.image} />
        <TextInput
          style={styles.input}
          placeholder="Şifre"
          onChange= {(e) => setPassword(e.target.value)}
          placeholderTextColor="#381163" 
        />
      </View>
      <View>
        <TouchableOpacity style={styles.forgetButton}>
          <View style={styles.buttonContent}>
            <Text style={styles.forgetButtonText}>Şifremi Unuttum</Text>
          </View>
        </TouchableOpacity>
      </View>
      <View>
      <TouchableOpacity style={styles.loginButton} onPress={handleSubmit}>
        <Text style={styles.loginButtonText}>Giriş Yap</Text>
      </TouchableOpacity>

      </View>
      <View>
       <Text style={styles.registerButton} onPress = {() => navigation.navigate('Register')}>
        <Text style={styles.registerButtonText}>
          Burada yeni misin? Hemen<Text style={styles.registerNavigate} > Kayıt Ol !</Text>
        </Text>
       </Text>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems:  'center',
  },
  header: {
    color: '#381163',
    fontWeight: '700',
    fontFamily: 'Hammersmith One',
    fontSize: 30,
    alignSelf: 'center'
  },
  header2: {
    color: '#381163',
    fontWeight: '700',
    fontFamily: 'Hammersmith One',
    fontSize: 22,
    marginTop:5,
    marginBottom: 30,
    alignSelf: 'center'
  },
  inputContainer: {
    marginTop: 20,
    alignItems: 'center',
    flexDirection: 'row', 
    borderBottomWidth: 2, 
    borderBottomColor: '#381163', 
  },
  input: {
    borderWidth: 0,
    borderColor: '#381163',
    borderRadius: 5,
    padding: 10,
    width: 250,
    marginTop: 10,
    marginBottom: 5,
    fontFamily: 'Hubballi',
    letterSpacing:2
  },
  image: {
    width: 40,
    height: 40,
    marginTop: 10,
    marginBottom: 5
  },
  loginButton: {
    backgroundColor: '#381163',
    borderRadius: 25,
    paddingHorizontal: 30,
    paddingVertical: 12,
    marginBottom:8,
    marginTop:2,
  },
  loginButtonText: {
    color: '#FFFFFF',
    fontSize: 18,
    letterSpacing: 3,
        fontFamily: 'Hubballi',

  },
  buttonContent: {
    flexDirection: 'row',
    marginLeft: 160
  },
  forgetButtonText:{
    color: '#381163',
    fontSize: 15,
    letterSpacing: 1,
    fontFamily: 'Hubballi',
    marginTop: 15, 
    marginBottom: 30
  },
  registerButton: {
    paddingHorizontal: 30,
    paddingVertical: 22,
    margin:20
  },
  registerButtonText: {
    color: '#381163',
    fontSize: 15,
    letterSpacing: 1,
        fontFamily: 'Hubballi',
  },
  registerNavigate: {
    textDecorationLine: 'underline'
  }
})
